import React from "react";
import {Route, Switch} from "react-router-dom";
import App from "./App";
import CreateNote from "./CreateNote";
import Note from "./Note";
import Error from "./Error";



const Routerpage = () =>{
   
    return(
        <>
        <Switch>
        <Route path="/" component={App} />

        </Switch>      
        </>
    );
}
export default Routerpage;
